import React from 'react';
import classes from './InputSetting.module.css'

const InputSetting = ({value,time,add,set,remove }) => {
  
  return(
    <div className={classes.input_wrapper}>
    <span className={classes.minus} onClick={remove}>-</span>
    <span className={classes.input_time}>
    <input type='text' value={value.minutes}className={classes.input} data-type='number'/>{time?' мин': <img src={require('./icon/tomato.png')} alt={1}></img> }
    </span>
    <span className={classes.plus} onClick={add??set}> +</span>
  </div>
  );
};

export default InputSetting;
